import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { StateProvider } from './context/StateContext';
import { Helmet } from 'react-helmet';
import { FaDatabase, FaTable, FaProjectDiagram, FaCode, FaCommentAlt, FaStream } from 'react-icons/fa'; // Added FaStream for FD

import ActionPanel from './components/ActionPanel';
import OutputPanel from './components/OutputPanel';
import CodePanel from './components/CodePanel';
import MessagePanel from './components/MessagePanel';
import NormalizedTableView from './components/NormalizedTableView';
import ERDiagramPage from './components/ERDiagramPage';
import FDPage from './components/FDPage'; // ✅ FD page import

import './style.css';
import '@fortawesome/fontawesome-free/css/all.min.css';

const PanelContainer = ({ children, title, icon }) => (
  <div className="panel-base">
    <div className="panel-header">
      <h3 className="panel-title">
        {icon && React.cloneElement(icon, { className: 'panel-icon' })}
        {title}
      </h3>
    </div>
    <div className="panel-content">
      {children}
    </div>
  </div>
);

const MainLayout = () => (
  <div className="app-container">
    <div className="left-panel">
      <PanelContainer title="Actions" icon={<FaDatabase />}>
        <ActionPanel />
      </PanelContainer>
    </div>

    <div className="center-panel">
      <PanelContainer title="Database Output" icon={<FaTable />}>
        <OutputPanel />
      </PanelContainer>
    </div>

    <div className="right-panel">
      <PanelContainer title="Messages" icon={<FaCommentAlt />} className="message-panel">
        <MessagePanel />
      </PanelContainer>

      <PanelContainer title="Generated Code" icon={<FaCode />} className="code-panel">
        <CodePanel />
      </PanelContainer>
    </div>
  </div>
);

const App = () => {
  return (
    <StateProvider>
      <Helmet>
        <title>Database Design Studio</title>
        <meta name="description" content="Tool for creating database designs and ER diagrams" />
        <link rel="preconnect" href="https://fonts.googleapis.com" />
        <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin="true" />
        <link
          href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&family=Fira+Code:wght@400;500&display=swap"
          rel="stylesheet"
        />
      </Helmet>

      <Router>
        <Routes>
          <Route path="/" element={<MainLayout />} />
          <Route
            path="/table-view"
            element={
              <PanelContainer title="Normalized Tables" icon={<FaTable />}>
                <NormalizedTableView />
              </PanelContainer>
            }
          />
          <Route
            path="/er-diagram"
            element={
              <PanelContainer title="ER Diagram" icon={<FaProjectDiagram />}>
                <ERDiagramPage />
              </PanelContainer>
            }
          />
          <Route
            path="/fd-view"
            element={
              <PanelContainer title="Detected Functional Dependencies" icon={<FaStream />}>
                <FDPage />
              </PanelContainer>
            }
          />
        </Routes>
      </Router>

      {/* SVG definitions for connection lines */}
      <svg className="svg-defs">
        <defs>
          <marker id="arrowhead" markerWidth="10" markerHeight="7" refX="9" refY="3.5" orient="auto">
            <polygon points="0 0, 10 3.5, 0 7" fill="#1a73e8" />
          </marker>
        </defs>
      </svg>
    </StateProvider>
  );
};

export default App;
